(function(){
	"use strict";
	var Block=function(canvObj){
		this.drawImg=function(img){
			canvObj.win.drawImage(img.tag,(this.xPos+((canvObj.blockDim/2)-(img.tag.width/2))),this.yPos);
		};
	};
	var EnemyCar=function(canvObj){
		var makeImg=function(imgSrc){
			var img=document.createElement("IMG");
			img.src=imgSrc;
			return {
				tag:img,
				bg:0
			};
		};
		var img=makeImg("data:image/png;base64,");
		this.car=new Block(canvObj);
		this.car.yStart=(0-canvObj.blockDim);
		this.car.yPos=this.car.yStart;
		this.randCol=function(){
			return Math.floor((Math.random()*3)+1)*canvObj.blockDim;
		};
		this.checkCol=function(otherBlock){
			if(typeof(otherBlock)!=="undefined"){
				while(this.car.xPos===otherBlock.car.xPos){
					this.car.xPos=this.randCol();
				}
			}
			else{
				return;
			}
		};
		this.car.xPos=this.randCol();
		this.loop=function(otherBlock){
			if(this.car.yPos>=canvObj.winHeight){
				this.car.yPos=this.car.yStart;
				this.car.xPos=this.randCol();
				this.checkCol(otherBlock);
				canvObj.scoreUp();
			}
		};
		this.checkHit=function(player){
			if((this.car.yPos+canvObj.blockDim)===player.car.yPos&&this.car.xPos===player.car.xPos){
				canvObj.gameOver();
			}
		};
		this.moveCar=function(otherBlock){
			this.checkCol(otherBlock);
			this.car.yPos=this.car.yPos+canvObj.blockSize;
			this.loop(otherBlock);
		};
		this.drawCar=function(){
			this.car.drawImg(img);
		};
	};
	var EnemyCars=function(canvObj){
		var i;
		var cars=[
			new EnemyCar(canvObj),
			new EnemyCar(canvObj)
		];
		this.startCars=function(player){
			for(i=0;i<cars.length;i++){
				if(i!==0){
					cars[i].moveCar(cars[0]);
				}
				else{
					cars[i].moveCar();
				}
				cars[i].checkHit(player);
				cars[i].drawCar();
			}
		};
	};
	var PlayerCar=function(canvObj){
		var makeImg=function(imgSrc){
			var img=document.createElement("IMG");
			img.src=imgSrc;
			return {
				tag:img,
				bg:0
			};
		};
		var img=makeImg("data:image/png;base64,");
		this.car=new Block(canvObj);
		this.car.xPos=(2*canvObj.blockDim);
		this.car.yPos=(canvObj.winHeight-canvObj.blockDim-canvObj.blockSize);
		this.direction=function(dir){
			var dirs={
				37:"left",
				39:"right"
			};
			if(typeof(dirs[dir])!=="undefined"){
				if(dirs[dir]==="left"&&this.car.xPos!==canvObj.blockDim){
					this.car.xPos=this.car.xPos-canvObj.blockDim;
				}
				else if(dirs[dir]==="right"&&this.car.xPos!==(3*canvObj.blockDim)){
					this.car.xPos=this.car.xPos+canvObj.blockDim;	
				}
			}
			else{
				return;
			}
		}
		this.draw=function(){
			this.car.drawImg(img);
		};
	};
	var CanvObj=function(canvTag){
		var makeImg=function(imgSrc){
			var img=document.createElement("IMG");
			img.src=imgSrc;
			return {
				tag:img,
				bg:0
			};
		};
		var img=makeImg("data:image/png;base64,");
		this.win=canvTag.getContext("2d");
		this.winWidth=canvTag.width;
		this.winHeight=canvTag.height;
		this.blockSize=10;
		this.blockWidth=60;
		this.blockDim=80;
		this.interId=null;
		this.score=0;
		this.speed=27;
		this.maxSpeed=12;
		this.level=1;
		this.gameOver=function(){
			clearInterval(this.interId);
			this.win.font="60px Comic Sans MS";
			this.win.fillStyle="black";
			this.win.textAlign="center";
			this.win.textBaseline="middle";
			this.win.fillText("Game Over",this.winWidth/2,this.winHeight/2);
		};
		this.scoreUp=function(){
			this.score+=(5/2);
		};
		this.levelUp=function(player,enemy){
			if(this.level<6){
				this.level++;
			}
			this.speed-=3;
			if(this.speed<this.maxSpeed){
				this.speed=this.maxSpeed;
			}
			clearInterval(this.interId);
			var canv=this;
			this.interId=setInterval(function(){
				canv.gameStart(player,enemy);
			},this.speed);
		};
		this.checkScore=function(player,enemy){
			if(this.score>=100&&this.level===1){
				this.levelUp(player,enemy);
			}
			else if(this.score>=200&&this.level===2){
				this.levelUp(player,enemy);
			}
			else if(this.score>=300&&this.level===3){
				this.levelUp(player,enemy);
			}
			else if(this.score>=400&&this.level===4){
				this.levelUp(player,enemy);
			}
			else if(this.score>=500&&this.level===5){
				this.levelUp(player,enemy);
			}
			else if(this.score>=600&&this.level===6){
				this.levelUp(player,enemy);
			}
		};
		this.drawRoad=function(img){
			if(img.bg>=(img.tag.height-1)){
				img.bg=0;
			}
			this.win.drawImage(img.tag,0,img.bg);
			this.win.drawImage(img.tag,0,img.bg-img.tag.height);
			img.bg+=this.blockSize;
		};
		this.drawLevel=function(){
			this.win.font="bold 23px Comic Sans MS";
			this.win.fillStyle="#000000";
			this.win.textAlign="left";
			this.win.textBaseline="top";
			this.win.fillText("Level:"+this.level,this.blockSize,(this.blockSize*4));
		};
		this.drawScore=function(){
			this.win.font="bold 23px Comic Sans MS";
			this.win.fillStyle="#000000";
			this.win.textAlign="left";
			this.win.textBaseline="top";
			this.win.fillText("Score:"+this.score,this.blockSize,this.blockSize);
		};
		this.drawBorder=function(){
			this.win.fillStyle="#a9a9a9";
			this.win.fillRect(0,0,this.winWidth,this.blockSize);
			this.win.fillRect(0,(this.winHeight-this.blockSize),this.winWidth,this.blockSize);
			this.win.fillRect(0,0,this.blockSize,this.winHeight);
			this.win.fillRect((this.winWidth-this.blockSize),0,this.blockSize,this.winHeight);
		};
		this.drawWin=function(){
			this.win.clearRect(0,0,this.winWidth,this.winHeight);
			this.win.fillStyle="#ffffff";
			this.win.fillRect(0,0,this.winWidth,this.winHeight);
			this.drawRoad(img,0);
		};
		this.gameStart=function(player,enemy){
			this.checkScore(player,enemy);
			this.drawWin();
			player.draw();
			enemy.startCars(player);
			this.drawBorder();
			this.drawScore();
			this.drawLevel();
		};
	};
	var fetchId=function(e_id){
		var element=document.getElementById(e_id);
		if(element!==null){
			return element;
		}
		else{
			return false;
		}
	};
	var canvas_tag=fetchId("main_canvas");
	var timeOut;
	var beforeStart=function(){
		var canv=new CanvObj(canvas_tag);
		var playerCar=new PlayerCar(canv);
		var enemyCars=new EnemyCars(canv);
		timeOut=setTimeout(function(){
			canv.gameStart(playerCar,enemyCars);
		},1);
	};
	var gameStart=function(){
		var canv=new CanvObj(canvas_tag);
		var playerCar=new PlayerCar(canv);
		var enemyCars=new EnemyCars(canv);
		canv.interId=setInterval(function(){
			canv.gameStart(playerCar,enemyCars);
		},canv.speed);
		document.body.onkeydown=function(eve){
			playerCar.direction(eve.keyCode);
		};
	};
	beforeStart();
	var startBtn=fetchId("start_game");
	startBtn.onclick=function(){
		gameStart();
		clearTimeout(timeOut);
	};
})();